   "source": [
    "## Loading and Cleaning Dataset\n",
    "\n",
    "**To get the data into a useful format, the categorical and ordinal features need to be identified and transformed.  It wouldn't make sense to compare experience as a text field or company size as a charater, so these fields will be converted to ordinal factors.  Other fields like job title and currency should be represented as unordered categorical features (i.e. factors).  \n",
    "To help reduce the complexity of the dataset, another column should also be added that reduces the number of job titles into a smaller subset of categories by pulling only the primary type of the role. It may also help to pull out features of the title such as _'manager'_ or _'lead'_ or _'intern'_ if they are prevalent enought to make a difference.**"
   ]
  },
