   "source": [
    "### Cleaning Job Titles\n",
    "**The job titles vary significantly, and many of the same types of jobs are referenced in different ways.  To make the job title more useful, a new encoding field will store the `super` class of the job indicated.**\n",
    "\n",
    "**There are also many job titles that include management or seniority measures.  These can be collected separately as the role level, with the default role level being \"1\".**"
   ]
  },
